import React from "react";
import Card from './Card';
import "./index.css";


function App() {
    return (
        <>
            <div className="cards">
                <Card
                    imgsrc="https://m.media-amazon.com/images/I/91G5xnoFOqL._AC_SY606_.jpg"
                    toptext="A Netflix original series"
                    title="DARK"
                    link="https://www.netflix.com/in/title/80100172"
                />
                <Card
                    imgsrc="https://talenthouse-res.cloudinary.com/image/upload/c_limit,f_auto,fl_progressive,h_1280,w_1280/v1542781501/user-936977/submissions/xlo46stvzbjboqp4lwsi.jpg"
                    toptext="Prime Originals"
                    title="Mirzapur"
                    link="https://www.primevideo.com/detail/0PDOKMV9CRLOMO5EUKNCUJLG4Q/ref=atv_sr_fle_c_Tn74RA_1_1_1?sr=1-1&pageTypeIdSource=ASIN&pageTypeId=B07J9PGN6R&qid=1644607415"
                />
                <Card
                    imgsrc="https://m.media-amazon.com/images/M/MV5BNDJkYzY3MzMtMGFhYi00MmQ4LWJkNTgtZGNiZWZmMTMxNzdlXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_FMjpg_UX1000_.jpg"
                    toptext="A Netflix original series"
                    title="Money Hiest"
                    link="www.netflix.com"
                />
            </div>
        </>

    );
}

export default App;
